const saludar = function (nombre) {
    return `Hola ${ nombre }`;
}

const saludar2 = (nombre) => {
    return `Hola ${ nombre }`;
}

console.log(saludar('Bryan'));
console.log(saludar2('Ariel'));

const getUser = () => (
    {
        uid: 'abc123',
        username: 'Goku'
    }
)

console.log(getUser());

// tarea

function getUsuarioActivo (nombre) {
    return {
        uid: 'asc',
        username: nombre
    }
}
